const Content = () => {
  return (
    <div className="diet-project">
      <Carousel />

      {/* Content Section */}
      <div className="content-section">
        <h2>About Our Diet Program</h2>
        <p>
          Our diet program is designed to help you achieve your health goals in a sustainable way. We believe that a balanced
          diet, rich in essential nutrients and tailored to your specific needs, is the foundation of a healthy lifestyle.
        </p>
        <p>
          Our approach focuses on whole foods and portion control, while allowing for flexibility and variety in meal options.
          We encourage the inclusion of a mix of proteins, healthy fats, carbohydrates, and plenty of fresh fruits and vegetables.
          Our goal is not just weight loss, but also fostering long-term healthy eating habits that will benefit you for life.
        </p>
        <p>
          By joining our program, youâ€™ll receive customized meal plans, regular check-ins, and access to a supportive community
          of health-minded individuals. Whether your goal is to lose weight, increase energy levels, or simply eat better, our
          diet program provides the guidance and motivation you need to succeed.
        </p>
      </div>
    </div>
  );
};

export default Content;
